import { BrowserRouter, Routes, Route, Link } from "react-router-dom";
import ClubInput from "../components/ClubInput";
import RequestHomePage from "../components/RequestHomePage";

//pages and components
//import Home from "./pages/Home";
//import Navbar from "./components/Navbar";

const ClubSite = () => {
  return (
    <div>
      <Link to="/">
      <img src="VT_Banner.png"></img>
      </Link>
      
      <Routes>
      <Route path="/" element={
        <Link to="/">
        <img src="VT_Banner.png"></img>
        </Link>
      }>
        <Route index element={<ClubInput/>} />  
        <Route path="/request" element={<RequestHomePage />} />
      </Route>
    </Routes>
      
        
        
      
    </div>
  );
};

export default ClubSite;
